       // See: https://github.com/OpenZeppelin/openzeppelin-contracts/pull/522\\r\\n        if (a == 0) {\\r\\n            return 0;\\r\\n        }\\r\\n\\r\\n        uint256 c = a * b;\\r\\n        require(c / a == b, \\"SafeMath: multiplication overflow\\");\\r\\n\\r\\n        return c;\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Returns the integer division of two unsigned integers. Reverts on\\r\\n     * division by zero. The result is rounded towards zero.\\r\\n     *\\r\\n     * Counterpart to Solidity\'s `/` operator. Note: this function uses a\\r\\n     * `revert` opcode (which leaves remaining gas untouched) while Solidity\\r\\n     * uses an invalid opcode to revert (consuming all remaining gas).\\r\\n     *\\r\\n     * Requirements:\\r\\n     *\\r\\n     * - The divisor cannot be zero.\\r\\n     */\\r\\n    function div(uint256 a, uint256 b) internal pure returns (uint256) {\\r\\n        return div(a, b, \\"SafeMath: division by zero\\");\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Returns the integer division of two unsigned integers. Reverts with custom message on\\r\\n     * division by zero. The result is rounded towards zero.\\r\\n     *\\r\\n     * Counterpart to Solidity\'s `/` operator. Note: this function uses a\\r\\n     * `revert` opcode (which leaves remaining gas untouched) while Solidity\\r\\n     * uses an invalid opcode to revert (consuming all remaining gas).\\r\\n     *\\r\\n     * Requirements:\\r\\n     *\\r\\n     * - The divisor cannot be zero.\\r\\n     */\\r\\n    function div(\\r\\n        uint256 a,\\r\\n        uint256 b,\\r\\n        string memory errorMessage\\r\\n    ) internal pure returns (uint256) {\\r\\n        require(b > 0, errorMessage);\\r\\n        uint256 c = a / b;\\r\\n        // assert(a == b * c + a % b); // There is no case in which this doesn\'t hold\\r\\n\\r\\n        return c;\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Returns the remainder of dividing two unsigned integers. (unsigned integer modulo),\\r\\n     * Reverts when dividing by zero.\\r\\n     *\\r\\n     * Counterpart to Solidity\'s `%` operator. This function uses a `revert`\\r\\n     * opcode (which leaves remaining gas untouched) while Solidity uses an\\r\\n     * invalid opcode to revert (consuming all remaining gas).\\r\\n     *\\r\\n     * Requirements:\\r\\n     *\\r\\n     * - The divisor cannot be zero.\\r\\n     */\\r\\n    function mod(uint256 a, uint256 b) internal pure returns (uint256) {\\r\\n        return mod(a, b, \\"SafeMath: modulo by zero\\");\\r\\n    }\\r\\n\\r\\n    /**\\r\\n     * @dev Returns the remainder of dividing two unsigned integers. (unsigned integer modulo),\\r\\n     * Reverts with custom message when dividing by zero.\\r\\n     *\\r\\n     * Counterpart to Solidity\'s `%` operator. This function uses a `revert`\\r\\n     * opcode (which leaves remaining gas untouched) while Solidity uses an\\r\\n     * invalid opcode to revert (consuming all remaining gas).\\r\\n     *\\r\\n     * Requirements:\\r\\n     *\\r\\n     * - The divisor cannot be zero.\\r\\n     */\\r\\n    function mod(\\r\\n        uint256 a,\\r\\n        uint256 b,\\r\\n        string memory errorMessage\\r\\n    ) internal pure returns (uint256) {\\r\\n        require(b != 0, errorMessage);\\r\\n        return a % b;\\r\\n    }\\r\\n}\\r\\n\\r\\ninterface IERC20 {\\r\\n    function transfer(address recipient, uint256 amount) external;\\r\\n\\r\\n    function balanceOf(address account) external view returns (uint256);\\r\\n\\r\\n    function transferFrom(\\r\\n        address sender,\\r\\n        address recipient,\\r\\n        uint256 amount\\r\\n    ) external;\\r\\n\\r\\n    function name() external view returns (string memory);\\r\\n\\r\\n    function decimals() external view returns (uint256);\\r\\n\\r\\n    event Transfer(address indexed from, address indexed to, uint256 value);\\r\\n}\\r\\n\\r\\ncontract Ownable {\\r\\n    address public owner;\\r\\n\\r\\n    constructor() {\\r\\n        owner = msg.sender;\\r\\n    }\\r\\n\\r\\n    modifier onlyOwner() {\\r\\n        require(msg.sender == owner);\\r\\n        _;\\r\\n    }\\r\\n}\\r\\n\\r\\ncontract DepositFactory is Ownable {\\r\\n    using SafeMath for uint256;\\r\\n\\r\\n    IERC20 token;\\r\\n    uint256 private depositIdx = 0;\\r\\n    uint256 constant MIN_SIGNATURES = 2;\\r\\n    string[] private allToken; //Store all ERC20 tokens\\r\\n\\r\\n    mapping(uint256 => Deposit) private depositId; //Storage deposit ID\\r\\n    mapping(address => uint256[]) private jiaGetId;\\r\\n    mapping(address => uint256[]) private yiGetId;\\r\\n    mapping(address => uint256[]) private bingGetId;\\r\\n    mapping(uint256 => MultiTransaction) private transactions;\\r\\n\\r\\n    struct Deposit {\\r\\n        address payable jia;\\r\\n        address payable yi;\\r\\n        address[] bing;\\r\\n        uint256 lockTime;\\r\\n        uint256 startTime;\\r\\n        uint256 releaseTime;\\r\\n        uint256 yajin;\\r\\n        uint256 remainedYajin;\\r\\n        uint256 tokenDecimals;\\r\\n        bool notQuarter;\\r\\n        bool notHalf;\\r\\n        string tokenName;\\r\\n    }\\r\\n\\r\\n    struct MultiTransaction {\\r\\n        address payable from;\\r\\n        // address payable to;\\r\\n        uint256 amount;\\r\\n        uint256 signatureCountJia;\\r\\n        uint256 signatureCountYi;\\r\\n        uint256 signatureCountOwner;\\r\\n        bool created;\\r\\n        string tokenName;\\r\\n    }\\r\\n\\r\\n    /**\\r\\n\\r\\n    modifier\\r\\n\\r\\n    */\\r\\n\\r\\n    modifier onlyJia(uint256 _depositId) {\\r\\n        require(\\r\\n            msg.sender == depositId[_depositId].jia &&\\r\\n                msg.sender != address(0x0)\\r\\n        );\\r\\n\\r\\n        require(\\r\\n            depositId[_depositId].yajin == depositId[_depositId].remainedYajin\\r\\n        );\\r\\n        _;\\r\\n    }\\r\\n\\r\\n    modifier onlyYi(uint256 _depositId) {\\r\\n        require(\\r\\n            msg.sender == depositId[_depositId].yi && msg.sender != address(0x0)\\r\\n        );\\r\\n\\r\\n        require(\\r\\n            depositId[_depositId].yajin == depositId[_depositId].remainedYajin\\r\\n        );\\r\\n        _;\\r\\n    }\\r\\n\\r\\n    modifier onlyBing(uint256 _depositId) {\\r\\n        require(msg.sender != address(0x0));\\r\\n        require(\\r\\n            msg.sender == depositId[_depositId].bing[0] ||\\r\\n                msg.sender == depositId[_depositId].bing[1] ||\\r\\n                msg.sender == depositId[_depositId].bing[2]\\r\\n        );\\r\\n        _;\\r\\n    }\\r\\n\\r\\n    modifier notOnTime(uint256 _depositId) {\\r\\n        require(\\r\\n            block.number < depositId[_depositId].releaseTime,\\r\\n            \\"The time is up.\\"\\r\\n        );\\r\\n        _;\\r\\n    }\\r\\n\\r\\n    modifier onlyYourself(address _addr) {\\r\\n        require(msg.sender == _addr);\\r\\n        _;\\r\\n    }\\r\\n\\r\\n    modifier notQuarter(uint256 _depositId) {\\r\\n        require(depositId[_depositId].notQuarter == true);\\r\\n        _;\\r\\n    }\\r\\n\\r\\n    modifier notHalf(uint256 _depositId) {\\r\\n        require(depositId[_depositId].notHalf == true);\\r\\n        _;\\r\\n    }\\r\\n\\r\\n    modifier remainZeroMoney(uint256 _depositId) {\\r\\n        require(depositId[_depositId].remainedYajin == 0);\\r\\n        _;\\r\\n    }\\r\\n\\r\\n    /**\\r\\n\\r\\n    event\\r\\n\\r\\n    */\\r\\n\\r\\n    event NewDeposit(\\r\\n        address payable from,\\r\\n        uint256 indexed depositId,\\r\\n        uint256 lockTime,\\r\\n        uint256 yajin,\\r\\n        uint256 tokenDecimals,\\r\\n        string tokenName,\\r\\n        bool notQuarter,\\r\\n        bool notHalf\\r\\n    );\\r\\n    // event FinishDeposit(\\r\\n    //     address payable from,\\r\\n    //     uint256 indexed depositId,\\r\\n    //     uint256 yajin,\\r\\n    //     string indexed tokenName\\r\\n    //     // string tokenSymbol\\r\\n    // ); //\u62bc\u91d1\u7ed9\u8c01\u4e86\\r\\n\\r\\n    event DepositFunds(address payable from, uint256 amount); //cun qian\\r\\n    event TransferFunds(\\r\\n        address to,\\r\\n        uint256 amount,\\r\\n        uint256 indexed ID,\\r\\n        string indexed tokenName\\r\\n    ); //\u62bc\u91d1\u7ed9\u8c01\u4e86\\r\\n    event BingIntervention(\\r\\n        address from,\\r\\n        uint256 depositId,\\r\\n        uint256 yajin,\\r\\n        uint256 signatureCountJia,\\r\\n        uint256 signatureCountYi,\\r\\n        string tokenName\\r\\n    );\\r\\n\\r\\n    // event OnlyOneBing(address to, uint256 yajin, uint256 depositId);\\r\\n\\r\\n    /**\\r\\n\\r\\n    constructor\\r\\n\\r\\n    */\\r\\n\\r\\n    constructor(IERC20 _token) {\\r\\n        token = _token;\\r\\n        allToken.push(token.name());\\r\\n    }\\r\\n\\r\\n    /**\\r\\n\\r\\n    private\\r\\n\\r\\n    */\\r\\n\\r\\n    function _generateRandomDepositID() private returns (uint256) {\\r\\n        depositIdx += 1;\\r\\n        uint256 rand =\\r\\n            uint256(\\r\\n                keccak256(\\r\\n                    abi.encodePacked(\\r\\n                        block.difficulty,\\r\\n                        block.timestamp,\\r\\n                        depositIdx,\\r\\n                        msg.value\\r\\n                    )\\r\\n                )\\r\\n            );\\r\\n        return rand.mod(10000000000);\\r\\n    }\\r\\n\\r\\n    function _withdrawToken(\\r\\n        uint256 _depositId,\\r\\n        address payable _addr,\\r\\n        uint256 _num\\r\\n    ) private {\\r\\n        if (\\r\\n            keccak256(abi.encodePacked(depositId[_depositId].tokenName)) ==\\r\\n            keccak256(abi.encodePacked(allToken[0]))\\r\\n        ) {\\r\\n            transferOut(_addr, depositId[_depositId].yajin.div(_num));\\r\\n        } else {\\r\\n            _addr.transfer(depositId[_depositId].yajin.div(_num));\\r\\n        }\\r\\n\\r\\n        depositId[_depositId].startTime += depositId[_depositId].lockTime.div(\\r\\n            _num\\r\\n        );\\r\\n        depositId[_depositId].remainedYajin -= depositId[_depositId].yajin.div(\\r\\n            _num\\r\\n        );\\r\\n    }\\r\\n\\r\\n    function _withdrawCoincidence(uint256 _depositId)\\r\\n        private\\r\\n        remainZeroMoney(_depositId)\\r\\n    {\\r\\n        finishDeposit(\\r\\n            _depositId,\\r\\n            depositId[_depositId].jia,\\r\\n            depositId[_depositId].yi\\r\\n        );\\r\\n    }\\r\\n\\r\\n    function _interventionVote(uint256 _depositId, address _toVote) private {\\r\\n        if (depositId[_depositId].jia == _toVote) {\\r\\n            transactions[_depositId].signatureCountJia += 1;\\r\\n        } else if (depositId[_depositId].yi == _toVote) {\\r\\n            transactions[_depositId].signatureCountYi += 1;\\r\\n        } else {\\r\\n            transactions[_depositId].signatureCountOwner += 1;\\r\\n        }\\r\\n    }\\r\\n\\r\\n    function _interventionYajin(uint256 _depositId, address payable _to)\\r\\n        private\\r\\n    {\\r\\n        require(address(this).balance >= transactions[_depositId].amount);\\r\\n\\r\\n        if (\\r\\n            keccak256(abi.encodePacked(depositId[_depositId].tokenName)) ==\\r\\n            keccak256(abi.encodePacked(allToken[0]))\\r\\n        ) {\\r\\n            transferOut(_to, transactions[_depositId].amount);\\r\\n        } else {\\r\\n            _to.transfer(transactions[_depositId].amount);\\r\\n        }\\r\\n\\r\\n        emit TransferFunds(\\r\\n            _to,\\r\\n            transactions[_depositId].amount,\\r\\n            _depositId,\\r\\n            depositId[_depositId].tokenName\\r\\n        );\\r\\n\\r\\n        finishDeposit(\\r\\n            _depositId,\\r\\n            depositId[_depositId].jia,\\r\\n            depositId[_depositId].yi\\r\\n        );\\r\\n    }\\r\\n\\r\\n    function finishDeposit(\\r\\n        uint256 _depositId,\\r\\n        address _jia,\\r\\n        address _yi\\r\\n    ) private {\\r\\n        address[] memory _bing = depositId[_depositId].bing;\\r\\n        depositId[_depositId].remainedYajin = 0;\\r\\n        for (uint256 i = 0; i < jiaGetId[_jia].length; i++) {\\r\\n            if (depositId[jiaGetId[_jia][i]].yajin == 0) {\\r\\n                jiaGetId[_jia][i] = 0;\\r\\n            }\\r\\n        }\\r\\n\\r\\n        for (uint256 i = 0; i < yiGetId[_yi].length; i++) {\\r\\n            if (depositId[yiGetId[_yi][i]].yajin == 0) {\\r\\n                yiGetId[_yi][i] = 0;\\r\\n            }\\r\\n        }\\r\\n\\r\\n        for (uint256 i = 0; i < _bing.length; i++) {\\r\\n            for (uint256 j = 0; j < bingGetId[_bing[i]].length; j++) {\\r\\n                if (depositId[bingGetId[_bing[i]][j]].yajin == 0) {\\r\\n                    bingGetId[_bing[i]][j] = 0;\\r\\n                }\\r\\n            }\\r\\n        }\\r\\n    }\\r\\n\\r\\n    /**\\r\\n\\r\\n    start\\r\\n\\r\\n    */\\r\\n\\r\\n    function createDeposit(\\r\\n        address payable _jia,\\r\\n        address[] memory _bing,\\r\\n        uint256 _time,\\r\\n        uint256 _yajin,\\r\\n        string memory _tokenName,\\r\\n        bool _notQuarter,\\r\\n        bool _notHalf\\r\\n    ) public payable {\\r\\n        require(address(this).balance < 500 ether);\\r\\n        require(_yajin > 0);\\r\\n        require(_time > 0);\\r\\n\\r\\n        depositIdx += 1;\\r\\n        uint256 _depositId = _generateRandomDepositID();\\r\\n        Deposit storage deposit = depositId[_depositId];\\r\\n        deposit.jia = _jia;\\r\\n        deposit.yi = payable(msg.sender);\\r\\n        deposit.bing = _bing;\\r\\n        deposit.lockTime = _time;\\r\\n        deposit.startTime = block.number;\\r\\n        deposit.releaseTime = deposit.startTime.add(_time); //60480\u4e2a\u533a\u5757\u5927\u7ea6\u4e00\u5468\\r\\n        deposit.tokenName = _tokenName;\\r\\n        deposit.notQuarter = _notQuarter;\\r\\n        deposit.notHalf = _notHalf;\\r\\n\\r\\n        jiaGetId[_jia].push(_depositId);\\r\\n        yiGetId[msg.sender].push(_depositId);\\r\\n\\r\\n        for (uint256 i = 0; i < _bing.length; i++) {\\r\\n            bingGetId[_bing[i]].push(_depositId);\\r\\n        }\\r\\n\\r\\n        if (\\r\\n            keccak256(abi.encodePacked(deposit.tokenName)) ==\\r\\n            keccak256(abi.encodePacked(allToken[0]))\\r\\n        ) {\\r\\n            deposit.tokenDecimals = token.decimals();\\r\\n            deposit.yajin = _yajin * (10**token.decimals());\\r\\n            deposit.remainedYajin = deposit.yajin;\\r\\n            transferIn(msg.sender, address(this), deposit.yajin);\\r\\n        } else {\\r\\n            deposit.tokenDecimals = 18;\\r\\n            deposit.yajin = msg.value;\\r\\n            deposit.remainedYajin = deposit.yajin;\\r\\n        }\\r\\n\\r\\n        emit NewDeposit(\\r\\n            payable(msg.sender),\\r\\n            _depositId,\\r\\n            deposit.lockTime,\\r\\n            deposit.yajin,\\r\\n            deposit.tokenDecimals,\\r\\n            deposit.tokenName,\\r\\n            deposit.notQuarter,\\r\\n            deposit.notHalf\\r\\n        );\\r\\n    }\\r\\n\\r\\n    /**\\r\\n\\r\\n    check\\r\\n\\r\\n    */\\r\\n\\r\\n    function jiaGetDepositId(address _jia)\\r\\n        public\\r\\n        view\\r\\n        onlyYourself(_jia)\\r\\n        returns (uint256[] memory)\\r\\n    {\\r\\n        return jiaGetId[_jia];\\r\\n    }\\r\\n\\r\\n    function yiGetDepositId(address _yi)\\r\\n        public\\r\\n        view\\r\\n        onlyYourself(_yi)\\r\\n        returns (uint256[] memory)\\r\\n    {\\r\\n        return yiGetId[_yi];\\r\\n    }\\r\\n\\r\\n    function bingGetDepositId(address _bing)\\r\\n        public\\r\\n        view\\r\\n        onlyYourself(_bing)\\r\\n        returns (uint256[] memory)\\r\\n    {\\r\\n        return bingGetId[_bing];\\r\\n    }\\r\\n\\r\\n    function getDepositDetails(uint256 _depositId)\\r\\n        public\\r\\n        view\\r\\n        returns (\\r\\n            address payable,\\r\\n            address payable,\\r\\n            address[] memory,\\r\\n            uint256,\\r\\n            uint256,\\r\\n            uint256,\\r\\n            uint256\\r\\n        )\\r\\n    {\\r\\n        return (\\r\\n            depositId[_depositId].jia,\\r\\n            depositId[_depositId].yi,\\r\\n            depositId[_depositId].bing,\\r\\n            depositId[_depositId].remainedYajin,\\r\\n            depositId[_depositId].lockTime,\\r\\n            depositId[_depositId].releaseTime,\\r\\n            depositId[_depositId].startTime\\r\\n        );\\r\\n    }\\r\\n\\r\\n    function getDepositTokenDetails(uint256 _depositId)\\r\\n        public\\r\\n        view\\r\\n        returns (uint256, string memory)\\r\\n    {\\r\\n        return (\\r\\n            depositId[_depositId].tokenDecimals,\\r\\n            depositId[_depositId].tokenName\\r\\n        );\\r\\n    }\\r\\n\\r\\n    function getRemainedTime(uint256 _depositId) public view returns (uint256) {\\r\\n        if (\\r\\n            (block.number - depositId[_depositId].startTime) <\\r\\n            depositId[_depositId].lockTime\\r\\n        ) {\\r\\n            return (depositId[_depositId].releaseTime - block.number);\\r\\n        } else {\\r\\n            return 0;\\r\\n        }\\r\\n    }\\r\\n\\r\\n    function whetherToAdvance(uint256 _depositId)\\r\\n        public\\r\\n        view\\r\\n        returns (bool, bool)\\r\\n    {\\r\\n        return (\\r\\n            depositId[_depositId].notHalf,\\r\\n            depositId[_depositId].notQuarter\\r\\n        );\\r\\n    }\\r\\n\\r\\n    function whoIsOwner() public view returns (address) {\\r\\n        return owner;\\r\\n    }\\r\\n\\r\\n    function getYourIntervention(uint256 _depositId)\\r\\n        public\\r\\n        view\\r\\n        returns (\\r\\n            address payable,\\r\\n            // address payable,\\r\\n            uint256,\\r\\n            uint256,\\r\\n            uint256,\\r\\n            uint256,\\r\\n            string memory\\r\\n        )\\r\\n    {\\r\\n        return (\\r\\n            transactions[_depositId].from,\\r\\n            // transactions[_mortgageId].to,\\r\\n            transactions[_depositId].amount,\\r\\n            transactions[_depositId].signatureCountJia,\\r\\n            transactions[_depositId].signatureCountYi,\\r\\n            transactions[_depositId].signatureCountOwner,\\r\\n            transactions[_depositId].tokenName\\r\\n        );\\r\\n    }\\r\\n\\r\\n    /**\\r\\n\\r\\n    withdraw\\r\\n\\r\\n    */\\r\\n\\r\\n    function withdrawJia(uint256 _depositId)\\r\\n        public\\r\\n        onlyYi(_depositId)\\r\\n        notOnTime(_depositId)\\r\\n    {\\r\\n        _withdrawToken(_depositId, depositId[_depositId].jia, 1);\\r\\n\\r\\n        emit TransferFunds(\\r\\n            depositId[_depositId].jia,\\r\\n            depositId[_depositId].yajin,\\r\\n            _depositId,\\r\\n            depositId[_depositId].tokenName\\r\\n        );\\r\\n\\r\\n        finishDeposit(\\r\\n            _depositId,\\r\\n            depositId[_depositId].jia,\\r\\n            depositId[_depositId].yi\\r\\n        );\\r\\n    }\\r\\n\\r\\n    function withdrawYi(uint256 _depositId)\\r\\n        public\\r\\n        onlyJia(_depositId)\\r\\n        notOnTime(_depositId)\\r\\n    {\\r\\n        _withdrawToken(_depositId, depositId[_depositId].yi, 1);\\r\\n\\r\\n        emit TransferFunds(\\r\\n            depositId[_depositId].yi,\\r\\n            depositId[_depositId].yajin,\\r\\n            _depositId,\\r\\n            depositId[_depositId].tokenName\\r\\n        );\\r\\n        finishDeposit(\\r\\n            _depositId,\\r\\n            depositId[_depositId].jia,\\r\\n            depositId[_depositId].yi\\r\\n        );\\r\\n    }\\r\\n\\r\\n    function withdrawQuarter(uint256 _depositId)\\r\\n        public\\r\\n        notOnTime(_depositId)\\r\\n        notQuarter(_depositId)\\r\\n    {\\r\\n        require(\\r\\n            block.number - depositId[_depositId].startTime >=\\r\\n                depositId[_depositId].lockTime.div(4)\\r\\n        );\\r\\n\\r\\n        _withdrawToken(_depositId, payable(msg.sender), 4);\\r\\n\\r\\n        _withdrawCoincidence(_depositId);\\r\\n    }\\r\\n\\r\\n    function withdrawHalf(uint256 _depositId)\\r\\n        public\\r\\n        notOnTime(_depositId)\\r\\n        notHalf(_depositId)\\r\\n    {\\r\\n        require(\\r\\n            block.number - depositId[_depositId].startTime >=\\r\\n                depositId[_depositId].lockTime.div(2)\\r\\n        );\\r\\n\\r\\n        _withdrawToken(_depositId, payable(msg.sender), 2);\\r\\n\\r\\n        _withdrawCoincidence(_depositId);\\r\\n    }\\r\\n\\r\\n    function withdrawOnTime(uint256 _depositId) public {\\r\\n        require(block.number >= depositId[_depositId].releaseTime);\\r\\n        require(depositId[_depositId].remainedYajin > 0);\\r\\n\\r\\n        _withdrawToken(_depositId, payable(msg.sender), 1);\\r\\n\\r\\n        emit TransferFunds(\\r\\n            payable(msg.sender),\\r\\n            depositId[_depositId].yajin,\\r\\n            _depositId,\\r\\n            depositId[_depositId].tokenName\\r\\n        );\\r\\n\\r\\n        finishDeposit(\\r\\n            _depositId,\\r\\n            depositId[_depositId].jia,\\r\\n            payable(msg.sender)\\r\\n        );\\r\\n    }\\r\\n\\r\\n    /**\\r\\n\\r\\n    other ERC20 token\\r\\n\\r\\n    */\\r\\n\\r\\n    function bingIntervention(address payable _to, uint256 _depositId)\\r\\n        public\\r\\n        onlyBing(_depositId)\\r\\n        notOnTime(_depositId)\\r\\n    {\\r\\n        if (depositId[_depositId].bing.length == 1) {\\r\\n            if (\\r\\n                keccak256(abi.encodePacked(depositId[_depositId].tokenName)) ==\\r\\n                keccak256(abi.encodePacked(allToken[0]))\\r\\n            ) {\\r\\n                transferOut(_to, depositId[_depositId].yajin);\\r\\n            } else {\\r\\n                _to.transfer(depositId[_depositId].yajin);\\r\\n            }\\r\\n\\r\\n            emit TransferFunds(\\r\\n                _to,\\r\\n                depositId[_depositId].remainedYajin,\\r\\n                _depositId,\\r\\n                depositId[_depositId].tokenName\\r\\n            );\\r\\n\\r\\n            finishDeposit(\\r\\n                _depositId,\\r\\n                depositId[_depositId].jia,\\r\\n                depositId[_depositId].yi\\r\\n            );\\r\\n        } else if (transactions[_depositId].created == true) {\\r\\n            require(address(0x0) != transactions[_depositId].from);\\r\\n            require(msg.sender != transactions[_depositId].from);\\r\\n\\r\\n            _interventionVote(_depositId, _to);\\r\\n\\r\\n            if (transactions[_depositId].signatureCountJia >= MIN_SIGNATURES) {\\r\\n                _interventionYajin(_depositId, depositId[_depositId].jia);\\r\\n            } else if (\\r\\n                transactions[_depositId].signatureCountYi >= MIN_SIGNATURES\\r\\n            ) {\\r\\n                _interventionYajin(_depositId, depositId[_depositId].yi);\\r\\n            } else if (\\r\\n                transactions[_depositId].signatureCountOwner >= MIN_SIGNATURES\\r\\n            ) {\\r\\n                _interventionYajin(_depositId, _to);\\r\\n            }\\r\\n        } else {\\r\\n            // transactionIdx += 1;\\r\\n            // uint256 _transactionId = uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp, transactionIdx, _mortgageId))) % 10000000000;\\r\\n\\r\\n            MultiTransaction storage transaction = transactions[_depositId];\\r\\n\\r\\n            transaction.from = payable(msg.sender);\\r\\n            // transaction.to = _to;\\r\\n            transaction.amount = depositId[_depositId].remainedYajin;\\r\\n            transaction.created = true;\\r\\n            // pendingMortgages.push(_mortgageId);\\r\\n\\r\\n            _interventionVote(_de